import {
    CREATE_TODO, 
    REMOVE_TODO, 
    MARK_TODO_AS_COMPLETED,
    LOAD_TODOS_FAILURE,
    LOAD_TODO_SUCCESS,
    LOAD_TODO_IN_PROGRESS
} from './actions'

/*export const isLoading = (state = false, action) => {
    const { type } = action
    switch(type)
    {
        case LOAD_TODO_IN_PROGRESS:{
